import firebase from 'firebase'

export const AUTH_VERIF ={
    apiKey: process.env.REACT_APP_DEV_API_ID,
    authDomain: process.env.REACT_APP_DEV_API_DOMAIN,
    databaseURL: "https://postapp-react.firebaseio.com",
    projectId: "postapp-react",
    storageBucket: "postapp-react.appspot.com",
}
const fireStAuth = firebase.initializeApp(AUTH_VERIF)
export default fireStAuth;
console.log(fireStAuth)
